import React, { Component } from 'react';

import './style.css';

class Header extends Component {

    render() {
        return (
            <nav className="nav navbar navbar-expand-lg navbar-light">
                <div className='logo-mockup'>Logo</div>
            </nav>
        )
    }
}

export default Header;
